import React from 'react'
import { Card, Button } from 'react-bootstrap'

const imageSource = "https://www.wfla.com/wp-content/uploads/sites/71/2020/06/spongebobgay.jpg?w=640";

const soundImage = "../public/icon-music.svg";

class CardDesign extends React.Component{

    render(){
        return(
            <Card style={{ width: '18rem'}}>
                <Card.Img variant="top" src={ imageSource } />
                <Card.Body>
                    <Card.Title className="text-center">
                        <h3>Order Summary</h3>
                        </Card.Title>
                    <Card.Text>

                        <p>You can now listen to millions of songs, audiobooks, and podcasts on any device anywhere you like!</p> 
                        <div className="debug-border cost-content">
                        <img src={ require(soundImage) } alt="gg"/>
                        </div>   
                    </Card.Text>
                </Card.Body>
            </Card>

        )
    }
}

export default CardDesign;
